import logo from "./logo.svg";
import "./App.css";
import { SimulationParamContainer } from "./SimulationParamContainer";
import { CreateSimulationButton } from "./createSimulationButton";
import { Title } from "./title";
import styled from "styled-components";

function App() {
  return (
    <div className="App">
      <link rel="stylesheet" href="https://use.typekit.net/vut8tpq.css" />
      <Title>
        Tissue Designer
      </Title>
      <SimulationColumn>
        <SimulationTitle>Simulations</SimulationTitle>
        <SimulationParamContainer></SimulationParamContainer>
        <SimulationParamContainer></SimulationParamContainer>
        <SimulationParamContainer></SimulationParamContainer>
        <SimulationParamContainer></SimulationParamContainer>
        <CreateSimulationButton />
      </SimulationColumn>
    </div>
  );

}
